import React, {useState} from "react";
import {CCarousel, CCarouselCaption, CCarouselItem, CImage} from '@coreui/react'
import {
    ArrowForward, ArrowRight,
    ColumnLeft,
    ColumnRight,
    HeroBtnWrapper,
    HeroContainer,
    HeroP, HeroTitle,
    HeroTitleRight,
    Mockup,
    Row
} from "./WheelyAppElements";
import mockup from "../../Images/profile.svg";
import {Button} from "../../Utilities/ButtonElements";
import mockup1 from "../../Images/garag.svg";

const WheelyApp = () => {

    const [hover, setHover] = useState(false);

    const onHover = () => {
        setHover(!hover);
    }


    return (
        <>
            <HeroContainer id="wheely-app">


                <CCarousel controls indicators>
                    <CCarouselItem>
                        <Mockup src={mockup1} alt="slide 1"/>
                        {/*<CImage  src={mockup} alt="slide 1" />*/}
                        <CCarouselCaption className="d-none d-md-block">
                            <h5>First slide label</h5>
                            <p>Some representative placeholder content for the first slide.</p>
                        </CCarouselCaption>
                    </CCarouselItem>
                    <CCarouselItem>
                        <Mockup src={mockup1} alt="slide 1"/>

                        {/*<CImage className="d-block w-100" src={mockup} alt="slide 2" />*/}
                        <CCarouselCaption className="d-none d-md-block">
                            <h5>Second slide label</h5>
                            <p>Some representative placeholder content for the first slide.</p>
                        </CCarouselCaption>
                    </CCarouselItem>
                    <CCarouselItem>
                        <Mockup src={mockup1} alt="slide 1"/>

                        {/*<CImage className="d-block w-100" src={mockup} alt="slide 3" />*/}
                        <CCarouselCaption className="d-none d-md-block">
                            <h5>Third slide label</h5>
                            <p>Some representative placeholder content for the first slide.</p>
                        </CCarouselCaption>
                    </CCarouselItem>
                </CCarousel>

            </HeroContainer>
        </>
    )
}

export default WheelyApp













